import pandas as pd

# Load the data from the csv files
def load_data(file_path_2012, file_path_2013):
    try:
        data_2012 = pd.read_csv(file_path_2012)
        data_2013 = pd.read_csv(file_path_2013)
        return data_2012, data_2013
    except Exception as e:
        print(f"Error loading data: {e}")

# Calculate the bacterial exceedance rate for each beach
def calculate_exceedance_rate(data):
    try:
        # Assuming 'Violation' column indicates exceedance
        exceedance_rate = data['Violation'].eq('yes').mean()
        return exceedance_rate
    except Exception as e:
        print(f"Error calculating exceedance rate: {e}")

# Compare the bacterial exceedance rates for each beach
def compare_exceedance_rates(data_2012, data_2013):
    try:
        # Group by 'Beach Name' and calculate exceedance rate for each group
        exceedance_rates_2012 = data_2012.groupby('Beach Name')['Violation'].apply(calculate_exceedance_rate)
        exceedance_rates_2013 = data_2013.groupby('Beach Name')['Violation'].apply(calculate_exceedance_rate)

        # Compare exceedance rates and count beaches with higher rate in 2013
        higher_rate_count = 0
        for beach in exceedance_rates_2013.index:
            if beach in exceedance_rates_2012.index:
                if exceedance_rates_2013[beach] > exceedance_rates_2012[beach]:
                    higher_rate_count += 1
        return higher_rate_count
    except Exception as e:
        print(f"Error comparing exceedance rates: {e}")

# Main function
def main():
    file_path_2012 = '/orcd/home/002/gerarvit/Kramabench/data/environment/input/water-body-testing-2012.csv'
    file_path_2013 = '/orcd/home/002/gerarvit/Kramabench/data/environment/input/water-body-testing-2013.csv'

    data_2012, data_2013 = load_data(file_path_2012, file_path_2013)
    answer1 = "Data loaded successfully"
    answer2 = "Exceedance rates calculated successfully"
    answer = compare_exceedance_rates(data_2012, data_2013)

    print(json.dumps(
        {"subtask-1": answer1, 
         "subtask-2": answer2, 
         "main-task": answer
        }, indent=4))

if __name__ == "__main__":
    main()

