import json
import pandas as pd

# Load the data from the csv files and handle missing values
def load_data(file_paths):
    data = []
    for file_path in file_paths:
        df = pd.read_csv(file_path)
        data.append(df)
    return data

# Filter the data for Wollaston Beach and count the number of bacterial exceedances for each year
def count_exceedances(data):
    exceedances = {}
    for df in data:
        year = df['Year'].unique()[0]
        wollaston_beach_data = df[df['Beach Name'] == 'Wollaston Beach']
        exceedances[year] = len(wollaston_beach_data[wollaston_beach_data['Violation'] == 'YES'])
    return exceedances

# Calculate the percentage of time the water quality met swimming standards for each year
def calculate_percentage(data, exceedances):
    percentages = {}
    for year, count in exceedances.items():
        for df in data:
            if df['Year'].unique()[0] == year:
                total_samples = len(df[df['Beach Name'] == 'Wollaston Beach'])
                if total_samples == 0:
                    percentage = 0
                else:
                    percentage = ((total_samples - count) / total_samples) * 100
                percentages[year] = int(percentage)
    return percentages

# Main function
def main():
    file_paths = ['/orcd/home/002/gerarvit/Kramabench/data/environment/input/water-body-testing-2019.csv', 
                  '/orcd/home/002/gerarvit/Kramabench/data/environment/input/water-body-testing-2020.csv', 
                  '/orcd/home/002/gerarvit/Kramabench/data/environment/input/water-body-testing-2021.csv', 
                  '/orcd/home/002/gerarvit/Kramabench/data/environment/input/water-body-testing-2022.csv', 
                  '/orcd/home/002/gerarvit/Kramabench/data/environment/input/water-body-testing-2023.csv']

    data = load_data(file_paths)
    exceedances = count_exceedances(data)
    percentages = calculate_percentage(data, exceedances)

    # Convert the keys of exceedances and percentages to string
    exceedances = {str(key): value for key, value in exceedances.items()}
    percentages = {str(key): value for key, value in percentages.items()}

    print(json.dumps({
        "subtask-1": "Data loaded successfully",
        "subtask-2": exceedances,
        "main-task": percentages
    }, indent=4))

if __name__ == "__main__":
    main()

