import pandas as pd
import json

# Load and clean the environmental-justice-populations.csv data
def load_environmental_justice_populations_data(file_path):
    try:
        data = pd.read_csv(file_path)
        return data
    except Exception as e:
        print(f"Error loading environmental-justice-populations.csv data: {e}")

# Load and clean the water-body-testing-2023.csv data
def load_water_body_testing_2023_data(file_path):
    try:
        data = pd.read_csv(file_path)
        return data
    except Exception as e:
        print(f"Error loading water-body-testing-2023.csv data: {e}")

# Filter the communities with more than 50% environmental justice (EJ) populations and those with less than 25% EJ populations
def filter_communities(data):
    try:
        more_than_50_ej = data[data['Percent of population in EJ BGs'] > 50]
        less_than_25_ej = data[data['Percent of population in EJ BGs'] < 25]
        return more_than_50_ej, less_than_25_ej
    except Exception as e:
        print(f"Error filtering communities: {e}")

# Calculate the bacterial exceedance rates for marine beach samples collected in 2023 for each community
def calculate_bacterial_exceedance_rates(data):
    try:
        marine_beach_samples = data[(data['Beach Type Description'] == 'Marine') & (data['Year'] == 2023)]
        bacterial_exceedance_rates = marine_beach_samples['Violation'].value_counts(normalize=True)
        return bacterial_exceedance_rates
    except Exception as e:
        print(f"Error calculating bacterial exceedance rates: {e}")

# Calculate the difference in bacterial exceedance rates between communities with more than 50% environmental justice (EJ) populations and those with less than 25% EJ populations
def calculate_difference_in_bacterial_exceedance_rates(more_than_50_ej, less_than_25_ej, water_body_testing_2023_data):
    try:
        more_than_50_ej_bacterial_exceedance_rates = calculate_bacterial_exceedance_rates(water_body_testing_2023_data[water_body_testing_2023_data['Community'].isin(more_than_50_ej['Municipality'])])
        less_than_25_ej_bacterial_exceedance_rates = calculate_bacterial_exceedance_rates(water_body_testing_2023_data[water_body_testing_2023_data['Community'].isin(less_than_25_ej['Municipality'])])
        difference_in_bacterial_exceedance_rates = more_than_50_ej_bacterial_exceedance_rates['Yes'] - less_than_25_ej_bacterial_exceedance_rates['Yes']
        return round(difference_in_bacterial_exceedance_rates, 2)
    except Exception as e:
        print(f"Error calculating difference in bacterial exceedance rates: {e}")

# Main function
def main():
    environmental_justice_populations_data = load_environmental_justice_populations_data('/orcd/home/002/gerarvit/Kramabench/data/environment/input/environmental-justice-populations.csv')
    water_body_testing_2023_data = load_water_body_testing_2023_data('/orcd/home/002/gerarvit/Kramabench/data/environment/input/water-body-testing-2023.csv')

    more_than_50_ej, less_than_25_ej = filter_communities(environmental_justice_populations_data)

    difference_in_bacterial_exceedance_rates = calculate_difference_in_bacterial_exceedance_rates(more_than_50_ej, less_than_25_ej, water_body_testing_2023_data)

    print(json.dumps({
        "main-task": difference_in_bacterial_exceedance_rates
    }, indent=4))

if __name__ == "__main__":
    main()

import json
import pandas as pd
import os

# Load the data from the given CSV files and handle missing values
def load_data(file_path):
    try:
        data = pd.read_csv(file_path)
        return data
    except Exception as e:
        print(f"Error loading {file_path}: {str(e)}")
        return None

# Extract the relevant columns (Date, 1-Day Rain, Enterococcus) from each CSV file
def extract_relevant_columns(data):
    if data is None:
        return None
    try:
        relevant_columns = data[["Date", "1-Day Rain", "Enterococcus"]]
        return relevant_columns
    except Exception as e:
        print(f"Error extracting relevant columns: {str(e)}")
        return None

# Identify samples that failed to meet the swimming standard (Enterococcus >= 104)
def identify_failed_samples(data):
    if data is None:
        return None
    try:
        failed_samples = data[data["Enterococcus"] >= 104]
        return failed_samples
    except Exception as e:
        print(f"Error identifying failed samples: {str(e)}")
        return None

# Determine which of these samples had rainfall within 24 hours prior to sampling (1-Day Rain > 0)
def determine_rainfall_samples(data):
    if data is None:
        return None
    try:
        rainfall_samples = data[data["1-Day Rain"] > 0]
        return rainfall_samples
    except Exception as e:
        print(f"Error determining rainfall samples: {str(e)}")
        return None

# Calculate the percentage of samples that failed to meet the swimming standard and had rainfall within 24 hours prior to sampling
def calculate_percentage(failed_samples, rainfall_samples):
    try:
        total_failed_samples = len(failed_samples)
        total_rainfall_samples = len(rainfall_samples)
        if total_failed_samples == 0:
            return 0
        percentage = (total_rainfall_samples / total_failed_samples) * 100
        return round(percentage, 2)
    except Exception as e:
        print(f"Error calculating percentage: {str(e)}")

# Main function
def main():
    file_paths = [
        "constitution_beach_datasheet.csv",
        "carson_beach_datasheet.csv",
        "pleasure_bay_and_castle_island_beach_datasheet.csv",
        "m_street_beach_datasheet.csv",
        "city_point_beach_datasheet.csv",
        "malibu_beach_datasheet.csv",
        "tenean_beach_datasheet.csv",
        "wollaston_beach_datasheet.csv"
    ]

    failed_samples_list = []
    rainfall_samples_list = []

    for file_path in file_paths:
        if not os.path.exists(file_path):
            print(f"File {file_path} does not exist. Skipping...")
            continue
        data = load_data(file_path)
        relevant_columns = extract_relevant_columns(data)
        failed_samples = identify_failed_samples(relevant_columns)
        rainfall_samples = determine_rainfall_samples(failed_samples)

        if failed_samples is not None:
            failed_samples_list.append(failed_samples)
        if rainfall_samples is not None:
            rainfall_samples_list.append(rainfall_samples)

    if failed_samples_list and rainfall_samples_list:
        total_failed_samples = pd.concat(failed_samples_list, ignore_index=True)
        total_rainfall_samples = pd.concat(rainfall_samples_list, ignore_index=True)

        percentage = calculate_percentage(total_failed_samples, total_rainfall_samples)
        print(json.dumps({"main-task": percentage}, indent=4))
    else:
        print(json.dumps({"main-task": 0}, indent=4))

if __name__ == "__main__":
    main()

