# Load the data from each beach's datasheet into a pandas DataFrame
def load_data(file_path):
    try:
        data = pd.read_csv(file_path)
        return data
    except Exception as e:
        print(f"Error loading data from {file_path}: {str(e)}")
        return None

# Clean and preprocess the data by handling missing values and converting data types
def clean_data(data):
    try:
        # Handle missing values
        data.fillna(0, inplace=True)

        # Convert data types
        data['Enterococcus'] = pd.to_numeric(data['Enterococcus'], errors='coerce')
        return data
    except Exception as e:
        print(f"Error cleaning data: {str(e)}")
        return None

# Count the number of samples where Enterococcus is greater than 104 at each beach
def count_samples(data):
    try:
        count = data[data['Enterococcus'] > 104].shape[0]
        return count
    except Exception as e:
        print(f"Error counting samples: {str(e)}")
        return None

# Main function
def main():
    file_paths = [
        'constitution_beach_datasheet.csv',
        'carson_beach_datasheet.csv',
        'pleasure_bay_and_castle_island_beach_datasheet.csv',
        'm_street_beach_datasheet.csv',
        'city_point_beach_datasheet.csv',
        'malibu_beach_datasheet.csv',
        'tenean_beach_datasheet.csv',
        'wollaston_beach_datasheet.csv'
    ]

    results = {}
    for file_path in file_paths:
        data = load_data(file_path)
        if data is not None:
            data = clean_data(data)
            if data is not None:
                count = count_samples(data)
                if count is not None:
                    results[file_path] = count

    print(json.dumps(results, indent=4))

