import json
import pandas as pd
import os

# Load the data from the given files and handle missing values
def load_data(file_paths):
    data = []
    for file_path in file_paths:
        if os.path.exists(file_path):
            df = pd.read_csv(file_path)
            df = df.replace('M', pd.NA)  # Replace 'M' with NaN
            df = df.replace(',', '', regex=True)  # Remove commas from numeric columns
            df['Year'] = pd.to_numeric(df['Year'], errors='coerce')
            df['Jun'] = pd.to_numeric(df['Jun'], errors='coerce')
            df['Jul'] = pd.to_numeric(df['Jul'], errors='coerce')
            df['Aug'] = pd.to_numeric(df['Aug'], errors='coerce')
            data.append(df)
        else:
            print(f"File {file_path} not found.")
    return data

# Calculate the total summer rainfall for each city in 2015
def calculate_summer_rainfall(data):
    summer_rainfall = []
    for df in data:
        city = df.columns[1]  # Get the city name from the column headers
        df_2015 = df[df['Year'] == 2015]
        if not df_2015.empty:
            total_rainfall = df_2015['Jun'].sum() + df_2015['Jul'].sum() + df_2015['Aug'].sum()
            summer_rainfall.append((city, total_rainfall))
    return summer_rainfall

# Find the city with the lowest total summer rainfall
def find_lowest_rainfall_city(summer_rainfall):
    if summer_rainfall:
        lowest_rainfall_city = min(summer_rainfall, key=lambda x: x[1])
        return lowest_rainfall_city
    else:
        return None

# Main function
def main():
    file_paths = [
        '/orcd/home/002/gerarvit/Kramabench/data/environment/input/monthly_precipitations_boston.csv',
        '/orcd/home/002/gerarvit/Kramabench/data/environment/input/monthly_precipitations_chatham.csv',
