        '/orcd/home/002/gerarvit/Kramabench/data/environment/input/monthly_precipitations_ashburnham.csv'
    ]

    data = load_data(file_paths)
    summer_rainfall = calculate_summer_rainfall(data)
    lowest_rainfall_city = find_lowest_rainfall_city(summer_rainfall)

    if lowest_rainfall_city:
        print(json.dumps({
            "subtask-1": "Data loaded successfully",
