import json
import pandas as pd

# Load the data from the water-body-testing-2015.csv file and handle any potential data issues.
def load_data(file_path):
    try:
        data = pd.read_csv(file_path)
        return data
    except Exception as e:
        print(f"Error loading data: {e}")

# Calculate the total number of samples for each beach.
def calculate_total_samples(data):
    total_samples = data['Beach Name'].value_counts().to_dict()
    return total_samples

# Calculate the number of violations for each beach.
def calculate_violations(data):
    violations = data[data['Violation'] == 'yes']
    violations_count = violations['Beach Name'].value_counts().to_dict()
    return violations_count

# Calculate the exceedance rate for each beach.
def calculate_exceedance_rate(total_samples, violations):
    exceedance_rates = {}
    for beach in total_samples:
        if beach in violations:
            exceedance_rate = violations[beach] / total_samples[beach]
        else:
            exceedance_rate = 0
        exceedance_rates[beach] = exceedance_rate
    return exceedance_rates

# Main function
def main():
    file_path = '/orcd/home/002/gerarvit/Kramabench/data/environment/input/water-body-testing-2015.csv'
    data = load_data(file_path)
    total_samples = calculate_total_samples(data)
    violations = calculate_violations(data)
    exceedance_rates = calculate_exceedance_rate(total_samples, violations)

    print(json.dumps(
        {
            "subtask-1": "Data loaded successfully",
            "subtask-2": total_samples,
            "subtask-3": violations,
            "subtask-4": exceedance_rates,
            "main-task": list(exceedance_rates.items())
        }, indent=4))

if __name__ == "__main__":
    main()
